import React from "react";

const Resume = ({
  fullName,
  email,
  phone,
  schools,
  works,
  handleName,
  handleEmail,
  handlePhone,
}) => {
  return (
    <div>
      <h1>{fullName}</h1>
      <h3>{email}</h3>
      <h3>{phone}</h3>
    </div>
  );
};

export default Resume;
